def detect_and_display_hand_with_index_finger(image_path):
    # Load image
    image = cv2.imread(image_path)

    # Initialize MediaPipe hands module
    mp_hands = mp.solutions.hands
    hands = mp_hands.Hands(static_image_mode=True, max_num_hands=1)

    # Convert the BGR image to RGB
    image_rgb = cv2.cvtColor(image, cv2.COLOR_BGR2RGB)

    # Process the image with MediaPipe hands
    results = hands.process(image_rgb)

    # Import mediapipe drawing utilities
    mp_drawing = mp.solutions.drawing_utils

    # Draw hand landmarks and index finger location on the image
    if results.multi_hand_landmarks:
        hand_landmarks = results.multi_hand_landmarks[0]  # Assuming only one hand is detected
        # Draw hand landmarks
        mp_drawing.draw_landmarks(
            image, hand_landmarks, mp_hands.HAND_CONNECTIONS)

        # Index finger landmark
        index_finger_landmark = hand_landmarks.landmark[mp_hands.HandLandmark.INDEX_FINGER_TIP]
        height, width, _ = image.shape
        x, y = int(index_finger_landmark.x * width), int(index_finger_landmark.y * height)

        # Draw green dot on the index finger tip
        cv2.circle(image, (x, y), 25, (0, 255, 0), -1)  # Green dot with radius 25 pixels

    # Release resources
    hands.close()

    # Display the image with detected hand and index finger using Matplotlib
    plt.imshow(cv2.cvtColor(image, cv2.COLOR_BGR2RGB))
    plt.axis('off')
    plt.show()

